import React from "react";
import styled from "styled-components";

function LandingPage() {
  return (
    <div>
      <img
        src="https://img.freepik.com/free-vector/character-design-ready-animation_79603-2201.jpg?t=st=1657754922~exp=1657755522~hmac=a74dead8b71976ce5d99a5c9764b317c418b8ba4571ea5870a978673a61d2222&w=2000"
        alt="manimage"
      ></img>
    </div>
  );
}

export default LandingPage;

const LandingContainer = styled.div`
  margin: 0;
`;
